import React from "react";
import style from '../../assets/css/App.styles' 
import { FormControl, InputLabel, Select ,Tab, Tabs, AppBar, makeStyles, Box, Typography, Theme, useTheme} from "@material-ui/core";
import CustomSelect from "../CustomSelect";
import SwipeableViews from 'react-swipeable-views';
import InventoryFilters from "../InventoryFilters";

interface TabPanelProps {
  children?: React.ReactNode;
  dir?: string;
  index: any;
  value: any;
}

function TabPanel(props: TabPanelProps) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`full-width-tabpanel-${index}`}
      aria-labelledby={`full-width-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

function a11yProps(index: any) {
  return {
    id: `full-width-tab-${index}`,
    'aria-controls': `full-width-tabpanel-${index}`,
  };
}

const useStyles = makeStyles((theme: Theme) => ({
  root: {
    backgroundColor: "white",
    width: 500,
  },
}));

const Filtros :  React.FC<{}> = () => {
  const classes = useStyles();
  const theme = useTheme();
  const [value, setValue] = React.useState(0);

  const handleChange = (event: React.ChangeEvent<{}>, newValue: number) => {
    setValue(newValue);
  };

  const handleChangeIndex = (index: number) => {
    setValue(index);
  };

    return (
      <div className={classes.root}>

        <Tabs
          value={value}
          onChange={handleChange}
          indicatorColor="primary"
          textColor="primary"
          variant="fullWidth"

        >
          <Tab label="Dig" icon="" {...a11yProps(0)} />
          <Tab label="Inventory" {...a11yProps(1)} />

        </Tabs>

      <SwipeableViews
        axis={theme.direction === 'rtl' ? 'x-reverse' : 'x'}
        index={value}
        onChangeIndex={handleChangeIndex}
      >
        <TabPanel value={value} index={0} dir={theme.direction}>
          Item One
        </TabPanel>
        <TabPanel value={value} index={1} dir={theme.direction}>
           <InventoryFilters  />

        </TabPanel>

      </SwipeableViews>
    </div>
    );


}

export default Filtros;
